// nebular  javascript API
// Bryce Mercines 2018


//create object
function nb_set(name,data){
	 var db = nb_DB;
	axios.post('nebular.php', $.param({
	    api: 'setObject',
	    db_name: db,
	    name: name,
	    content: data
  }))
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });
}

// append data to object
function nb_put(name,data){
	 var db = nb_DB;
	axios.post('nebular.php', $.param({
	    api: 'putObject',
	    db_name: db,
	    name: name,
	    content: data
  }))
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });
}


var resp;



function nb_get(name){
     if(nb_DB){
       var db = nb_DB;
	axios.post('nebular.php', $.param({
	    api: 'getObject',
	    db_name: db,
	    name: name,
  }))
  .then(function (response) {
    resp = response.data.data; 
  })
  .catch(function (error) {
    console.log(error);
  });
	
     }else{
     	console.log('Nebular: Error! no DB is selected use var nb_DB="db_name" to select a database.');
     }
	return resp;
}

function nb_select(name){
	var db = nb_DB;
	return axios.post('nebular.php',$.param({
		api: 'getObject',
		db_name: db,
		name: name
	}));
	
}


// delete object
function nb_delete(name){
	var db = nb_DB;
    axios.get('nebular.php?api=deleteObject&db_name='+db+'&name='+name)
	.then(function(res){
		console.log(res.data);
	}).catch(function(err){
		console.log(err);
	});
	
}

// request auth()

function nb_auth(api_key){
	axios.get('./nebular-src/nebular.auth.php?chk_key='+api_key)
	  .then((res)=>{
         console.log('Nebular: API is Active');
	  })
}



// static function for directly parsing object data
// element is prefixed with a hash if element is identified by id!
function nb_parse(element,objectname){
	var db = nb_DB;
   $(element).load('./nebular-src/vm/'+db+'/'+objectname);
}